import Links from './Links';

const Header=()=>{
    return (
<div>

        <header className="header">

            <a href="https://adalab.es/"> <img className="logo" src={image} alt="adalab-logo" title="Go to Adalab"/> </a>
            <nav>
     <Links   openInNewTab={true} />
     <Links openInNewTab={true} />
            </nav>
        </header>
</div>
    );
}

export default Header;
